106100003.Description:
เมื่อมีพลังงานมากพอ กด <IconMap:Icon_SpecialReady> เพื่อ
ใช้ Slash อย่างรุนแรงไปข้างหน้าอย่างต่อเนื่อง
และทำให้เลื่อยไฟฟ้าระเบิดหลังจากนั้น
เพื่อสร้าง<color=#F0D12B>ความเสียหายกายภาพ</color>ปริมาณมาก;
เมื่อกดต่อเนื่อง หรือกดค้าง จะสามารถใช้เลื่อยไฟฟ้า ทำการ Slash ใส่ศัตรูอย่างต่อเนื่อง โดยเมื่อการโจมตีถูกเป้าหมาย พลังงานจะค่อยๆ ลดลง;
ในช่วง Cyclone Slash จะมีเอฟเฟกต์ Invulnerable;
ระหว่างที่ใช้ Slash อย่างต่อเนื่อง เลเวล Anti-Interrupt จะเพิ่มขึ้น
และความเสียหายที่ได้รับจะลดลง 40%

106100004.Description:
กด <IconMap:Icon_Evade> เพื่อ
พุ่งหลบอย่างรวดเร็ว;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable

106100007.Description:
เมื่อเกิด <color=#FFFFFF>[สกิลต่อเนื่อง]</color> เลือกตัวละครที่สอดคล้องเพื่อ
ใช้ Slash อย่างรุนแรงไปยังศัตรูข้างหน้า ที่อยู่ในพื้นที่วงแคบ
เพื่อสร้าง<color=#F0D12B>ความเสียหายกายภาพ</color>ปริมาณมาก;
เมื่อกดต่อเนื่อง หรือกดค้าง
จะสามารถใช้เลื่อยไฟฟ้าทำการ Slash ใส่ศัตรูได้อย่างต่อเนื่อง;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable

106100008.Description:
เมื่อ Decibel Rating ถึง <color=#FFFFFF>[Maximum]</color> กด <IconMap:Icon_UltimateReady> เพื่อ
ใช้ Slash อย่างรุนแรงไปยังศัตรูข้างหน้า ที่อยู่ในพื้นที่วงแคบ
เพื่อสร้าง<color=#F0D12B>ความเสียหายกายภาพ</color>ปริมาณมาก;
เมื่อกดต่อเนื่อง หรือกดค้าง
จะสามารถใช้เลื่อยไฟฟ้าทำการ Slash ใส่ศัตรูได้อย่างต่อเนื่อง;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable

106100011.Description:
เมื่อตัวละครที่อยู่ในสนาม กำลังจะถูกโจมตี กด <IconMap:Icon_Switch> เพื่อ
ตั้งรับการโจมตีของศัตรู และสะสม Daze ปริมาณมาก;
มีประสิทธิภาพการตั้งรับที่ค่อนข้างยอดเยี่ยม โดยเมื่อถูกการโจมตีที่รุนแรง ปริมาณ <color=#FFFFFF>[แต้มซัปพอร์ต]</color> ที่ใช้จะลดลง;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable

106100012.Description:
หลังจากใช้ <color=#FFFFFF>[ซัปพอร์ตตั้งรับ]</color> กด <IconMap:Icon_Normal> เพื่อ
ใช้ Slash อย่างต่อเนื่องใส่ศัตรูที่อยู่ข้างหน้า และทำให้เลื่อยไฟฟ้าระเบิดหลังจากนั้น เพื่อสร้าง<color=#F0D12B>ความเสียหายกายภาพ</color>;
เมื่อกดต่อเนื่อง หรือกดค้าง
จะสามารถใช้เลื่อยไฟฟ้าทำการ Slash ใส่ศัตรูได้อย่างต่อเนื่อง;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable
